За видеовызовы плата взимается не так, как за обычные голосовые вызовы"
\u0009• Для голосовой части вызова используется поминутная тарификация голосовой связи вашего тарифного плана 
\u0009• Для видеочасти используется тарифный план для передачи данных 

Видеовызов работает, если все его участники: 
\u0009• являются клиентами AT&T с оплатой по факту; 
\u0009• настроили видеовызов на своем аккаунте; 
\u0009• имеют устройства с поддержкой видеовызовов; 
\u0009• находятся в зоне действия голосовой связи AT&T в качестве HD. 

Видеовызовы должны начинаться в беспроводной сети AT&T, затем они автоматически переключаются в сеть Wi-Fi, если она доступна. За передачу данных и голоса по сети Wi-Fi плата не взимается. 

Дополнительную информацию и ограничения см. на веб-сайте "www.att.com/videocall.
